Description:
Data Analyst, Quantitative Research Education Practice AreaHanover ResearchThe RoleAbout HanoverResponsibilities
Perform advanced statistical modeling and regression analysis on education related data;
Design and develop customized quantitative research reports on various topics for Education clients;
Collaborate with Content Directors on defining project scopes for client deliverables;
Analyze complex research requests to provide actionable recommendations and key findings;
Compile online sources from relevant databases to support recommendations and insights;
Form hypotheses and locate compelling support for arguments under very tight deadlines;
Manage tight deadlines to create reports requiring few edits;
Train other team members in statistical and quantitative research methodologies;
Serve as project lead for Research Associates, assisting with project design and development;
Review formatting and data accuracy in key deliverables;
Provide guidance and constructive feedback to peer research reports.
Desired Skills and AttributesTechnical Skills
Advanced knowledge of and ability to apply econometric and statistical methods to practical research problems;
High comfort level with statistical analysis software, particularly R and Stata. Experience with other programming languages such as Python, with database systems and SQL, or with other analysis tools such as Tableau and ArcGIS is a plus;
Experience working with and preparing real-world datasets for analysis, including identifying anomalies and reshaping or merging data;
Willingness and ability to pick up new quantitative skills and market research methodologies as necessary and apply them in new contexts;
High comfort level with Microsoft Office applications, such as MS Word, MS Excel, and MS Power Point.
Other Skills and Attributes
Strong command of the English language and demonstrated writing and editing skills, including experience writing or presenting for a business or non-technical professional audience;
Demonstrable problem solving skills;
Willingness to tackle complex, often unfamiliar research requests;
Ability to collaborate and strategize with senior-level research directors;
Ability to prioritize and manage multiple short and long-term projects in order to meet deadlines;
Ability to work quickly and independently with minimal guidance or oversight;
Ability to work under pressure and multitask in a fast-paced environment;
Ability to accept feedback and constructive critique positively;
Excellent organizational skills and attention to detail;
Excellent interpersonal and communication skills;
Extremely strong and demonstrable work ethic
Education RequirementExperience RequirementLocationBenefits
Base salary
401(K) employer matching program
Comprehensive health and dental benefits package
Advancement and management opportunities
Community service opportunities

 02-Mar-2020 (EST)Data AnalyticsStoughton, MA, USAFull Time 


Email Me Similar Jobs Email Me This Job
 Business overview:

As the first and largest specialty pharmacy integrator and accelerator, Shields Health Solutions sits at the nexus of the $200B specialty pharmacy industry. Shields builds and manages hospital-owned specialty pharmacies for health systems who want to offer coordinated care services for patients with chronic illness. Shields Health Solutions' patient-centric TelemetryRx platform enables health systems to improve medication adherence, reduce patient readmission rates, and ultimately improve health outcomes through the collection and distillation of clinical, behavioral, and financial data. Shields Health Solutions is one of the fastest growing healthcare companies and has proven its immense impact on patients' lives

Whom we are looking for:

We are searching for an analytical and energetic team-member who is looking for a challenging career with a fast-growing company in HealthTech. We want to meet with those of you who measure yourself on results, statistical rigor, and quality. You should be as excited by data analytics as we are; gleaming insights from noise to portray a story that informs how we think about our business. Having the foresight to anticipate potential issues and the action-bias to propose solutions. We want to rely on you to complete your work without constant oversight; we will guide you along the way to success but do not micromanage. Most importantly, we all work together as members of a close-knit team, supporting and learning from one another. If you smile reading through this, we want you on our team.

What you will do:

Enable the success of our Data Analytics team, including our innovative TelemetryRx platform. You will complete analyses of opportunities to attract new patients, improve our care model, and analyze the financial success of our business. Importantly, you will be a key member of the team that provides detailed data and quantitative analysis, statistics and trends reporting, and predictive modeling that support sales, operations, finance and executive teams.

Specific Skills/Qualifications:

At least two years experience in:


Collecting and organizing data from disparate sources
Developing and implementing data analyses on collected data
Interpreting data, and analyzing results using statistical techniques
Identifying trends in data
Automating reports
Partnering with the business groups to define reporting requirements
Developing dashboards and reports within Tableau
Data mining, aggregation and manipulation



Demonstrated programming experience in R, python, SQL or similar
Proficient with MS Excel
Knowledge of statistics and trend reporting
Strong business judgment
Energetic, highly motivated and organized
Strong attention to detail
Ability to communicate complex topics in easily understandable manner
Discretion and confidentiality essential

Nice to have:


Knowledge of database design and constructs
Knowledge of predictive modeling
Prior healthcare/pharmacy data experience




Job Duties:

Prepare scheduled reports, providing insights on key company functions;
Develop processes to automate those reports;
Optimize, monitor, maintain and automate existing reports;
Develops, implements and maintains program forecasting models; track performance vs. forecast; communicates discrepancies to the organization;
Achieves operational objectives by contributing information and detailed data analysis using R, python or similar programs;
Assist in developing data and quantitative analyses for building predictive models;
Assist with ad hoc questions and data needs;
Guides other departments by researching, analyzing and interpreting data;
Applies observations and recommendations to operational issues that will increase productivity, quality, and customer-service standards;
Identifies trends; resolves problems; determines system improvements; implements change;
Reviews new business opportunities to identify the impact to the financial outlook of the organization;
Actively participates in process improvement initiatives;
Acts as a strategic and value-added business partner to stakeholder throughout the organization;
Protects organization's value by keeping information confidential;

Updates job knowledge by:


Participating in educational opportunities;
Reading professional publications;
Maintaining personal networks;
Participating in professional organizations;



Other duties as assigned;



Shields Health Solutions

