Job title: Data Analyst (W2 candidate Only)Location: Hartford CTOne of leading companies in the healthcare industry is now hiring a hands-on Data Analyst with 5+ years’ experience as one of those roles of data modeling, data analysis and even data architect and experience of OLTP and OLAP system design.
Should be working with multiple data sources including Salesforce or Dynamics. Must be able to work with business and data sources independently to understand data availability and business insights that can be driven.
Experience of owning & managing all changes to the models, solution designs, and architecture documentation; determining database structural requirements by analyzing client operations, applications, and programming; reviewing objectives with clients; evaluating current systems;
Extensive experience in Relational Data Modelling, Dimensional Data Modelling, Logical/Physical Design, ER Diagrams, Forward and Reverse Engineering ERWIN diagrams, analyzing data sources and creating interface documents;
Proficient in data mart design and creation of cubes using dimensional data modeling – identifying Facts and Dimensions, Star Schema and Snowflake Schema;
Experience in SQL and good knowledge in SQL/SAS programming and experience of ETL tool of SSIS and reporting tool of SSRS;
Great communication and a passion for driving insights from data, working with developers’ analysts and business, writing or reviewing functional specs as needed etc.

